import styles from './Cart.module.css';
import Modal from '../UI/Modal';
const Cart = (props) => {
    const cartItems = [{ id: 'C1', name: 'Ampligo', quantity: 500, price: 450 }].map(item => <li>{item.name}</li>)
    return (
        <Modal>
            {cartItems}
            <div className={styles.total}>
                <span>Total Amount-</span>
                <span> 400</span>

            </div>
            <div className={styles.action}>
                <button className={styles.button}>Close</button>
                <button>Order</button>
            </div>

        </Modal>


    )
}

export default Cart;
